import React from 'react';
import logo from '../../logo.svg';
import { Fun }  from '../Header/Fun';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header" />
      <Fun something="new, and im so very in love with it" />
    </div>
  );
}

export default App;
